import React from "react";
import Cart2 from "../Cart2";
import "./Frame3500.css";

function Frame3500(props) {
  const { text37, cart2Props, className } = props;

  return (
    <div className={`frame-35002 ${className || ""}`}>
      <div className="frame-3595">
        <Cart2
          vector2={cart2Props.vector2}
          vector1={cart2Props.vector1}
          vector6={cart2Props.vector6}
          vector7={cart2Props.vector7}
        />
        <div className="text-37 ibmplexsans-semi-bold-quarter-spanish-white-16px">{text37}</div>
      </div>
    </div>
  );
}

export default Frame3500;
